// SPDX-License-Identifier: MIT
pragma solidity 0.8.13;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/token/ERC721/IERC721Receiver.sol";


contract Trader {   
    //store NFT to sell data
    mapping(address => mapping(uint => Listing)) public listings;
    //store funds received by the seller
    mapping(address => uint) public balances;

    struct Listing {
        uint price;
        address seller;
    }

    function addListing(uint _price, address _contractAddress, uint _tokenId) public {
        //interacting with the collection smartcontract
        ERC721 token = ERC721(_contractAddress);
        require(token.balanceOf(msg.sender) > 0, "caller must own token");
        require(token.isApprovedForAll(msg.sender, address(this)), "contract must be approved");

        listings[_contractAddress][_tokenId] = Listing(_price, msg.sender);   
    }

    function buyNFT(address _contractAddress, uint _tokenId) public payable {
        Listing memory item =listings[_contractAddress][_tokenId];
        require(msg.value >= item.price, "insufficient funds");
        balances[item.seller] += msg.value;
        ERC721 token = ERC721(_contractAddress);
        token.safeTransferFrom(item.seller, msg.sender, _tokenId, "");
    }

    function withdraw(uint _amount, address payable _toAddress) public {
        require(_amount <= balances[msg.sender], "insufficient funds");

        _toAddress.transfer(_amount);
        balances[msg.sender] -= _amount;
    }

}
